ной почты','Send link button label'=>'Этикетка кнопки отправки ссылки','<p>Your form has been saved as draft and a resume link has been generated so you can return to the form anytime within {retention_period} days from today. Copy and save the link or enter your email address below to have the link sent to your mail.</p><p>These fields weren\'t saved to your submission draft: Paypal, Stripe, Signature, Password, Captcha, and Upload. Kindly fill them out before submitting the form.</p>'=>'<p>Ваша форма была сохранена как черновик, и была создана ссылка для возобновления, чтобы вы могли вернуться к форме в любое время в течение {retention_period} дней с сегодняшнего дня. Скопируйте и сохраните ссылку или введите свой адрес электронной почты ниже, чтобы ссылка была отправлена на вашу почту.</p><p>Эти поля не были сохранены в черновике вашей заявки: Paypal, Stripe, Signature, Password, Captcha и Upload. . Пожалуйста, заполните их перед отправкой формы.</p>','E.g., johndoe@gmail.com'=>'Напр.: johndoe@gmail.com','Public'=>'Публичное','Save and Continue'=>'Сохранить и продолжить','We\'ve noticed you have updated to Forminator Pro version %s. Please ensure you also update your Forminator Stripe Subscriptions Add-on to version 1.0.4 or higher to ensure compatibility with the new submissions processes.'=>'Мы заметили, что вы обновились до версии Forminator Pro %s. Пожалуйста, убедитесь, что вы также обновили надстройку подписки на Forminator Stripe до версии 1.0.4 или выше, чтобы обеспечить совместимость с новыми процессами отправки.','Having problems? Try another way to log in'=>'Возникли проблемы? Попробуйте другой способ входа в систему','Your code has been sent to your email.'=>'Ваш код был отправлен на вашу электронную почту.','Please try again.'=>'Попробуйте ещё раз.','Disable this feature to prevent submissions from being stored in your database. Note that any submissions previously stored in the database will be retained and automatically deleted according to the retention schedule configured in the Privacy settings below.'=>'Отключите эту функцию, чтобы предотвратить сохранение отправленных данных в вашей базе данных. Обратите внимание, что все материалы, ранее сохраненные в базе данных, будут сохранены и автоматически удалены в соответствии с графиком хранения, настроенным в настройках конфиденциальности ниже.','Format%s %s %s'=>'Формат%s %s %s','At least one of Title, Content, or Excerpt must be enabled for post data to be submitted.'=>'Для отправки данных публикации должен быть включен хотя бы один из заголовков, содержания или выдержки.','Store Submissions in Database'=>'Хранить материалы в базе данных','Is greater than'=>'Больше , чем','Is less than'=>'Это меньше, чем','Markdown supported for card description. Find complete guide %shere%s.'=>'Поддерживается уценка для описания карты. Найдите полное руководство %shere%s.','Please input valid API Key'=>'Пожалуйста, введите действительный ключ API','Property does not exist'=>'Собственность не существует','Set Up %1$s'=>'Настройка %1$s','Your Trello account is already authorized. Edit info below to re-authorize.'=>'Ваша учетная запись Trello уже авторизована. Отредактируйте информацию ниже, чтобы выполнить повторную авторизацию.','Preset'=>'Предустановка','Appearance Presets'=>'Настройки внешнего вида','Apply Appearance Preset'=>'Применить предустановленный внешний вид','Are you sure you want to delete this preset?'=>'Вы уверены, что хотите удалить эту предустановку?','Create Preset'=>'Создание пресета','Creating...'=>'Создание...','Default Preset'=>'Предустановка по умолчанию','Delete Preset'=>'Удалить предустановку','E.g., New preset'=>'Например, Новая предустановка','Enter a name for your new preset below.'=>'Введите имя для вашего нового пресета ниже.','Import style from form (Optional)'=>'Импорт стиля из формы (необязательно)','New Preset'=>'Новый пресет','Preset Name'=>'Имя предустановки','Thank you. Your post has been submitted.'=>'Спасибо. Ваш пост был отправлен.','Yo