ям формы','Get Forminator Pro, our full lineup of WordPress marketing tools and more for free when you start your WPMU DEV membership.'=>'Получите Forminator Pro, наш полный набор маркетинговых инструментов WordPress и многое другое бесплатно, когда вы начнете свое членство в WPMU DEV.','Manage unlimited WordPress sites from the Hub'=>'Управляйте неограниченным количеством сайтов WordPress из Хаба','Premium form fields and E-Signature integration'=>'Поля премиум-формы и интеграция электронной подписи','Smush and Hummingbird Pro performance pack'=>'Smush и Hummingbird Pro performance pack','Pro'=>'Pro','24/7 live WordPress support'=>'24/7 поддержка в реальном времени','The WPMU DEV Guarantee'=>'Гарантия разработчика WPMU','Instagram'=>'Instagram','More information about %s'=>'Дополнительная информация о %s','Renew Membership'=>'Возобновить членство','By %s'=>'От %s','Premium Support'=>'Премиум-поддержка','Upgrade'=>'Обновить','View details'=>'Посмотреть деталей','Upgrade to Forminator Pro'=>'Обновление до Forminator Pro','Are you sure you want to approve and activate this user?'=>'Вы уверены, что хотите одобрить и активировать этого пользователя?','Approve User'=>'Утвердить Пользователя','Create interactive polls to collect users\' opinions, with lots of dynamic options and settings.'=>'Создавайте интерактивные опросы для сбора мнений пользователей с множеством динамических опций и настроек.','Error! User was not approved.'=>'Ошибка! Пользователь не был одобрен.','Approve'=>'Одобрить','Evaluation loader icon'=>'Значок загрузчика для оценки','Password error message'=>'Сообщение об ошибке пароля','Site Title'=>'Название сайта','Maximum width'=>'Максимальная ширина','Maximum Width'=>'Максимальная ширина','Site Name'=>'Название сайта','Full Width'=>'Во всю ширину','Add an optional border around the quiz.'=>'Добавьте необязательную рамку вокруг теста.','Add Custom User Meta'=>'Добавить Пользовательскую пользовательскую мету','Assign form fields to the default WordPress site meta keys below.'=>'Назначьте поля формы мета-ключам сайта WordPress по умолчанию, приведенным ниже.','By default the quiz will fill the available space where you insert it. You can add some padding here to better suit your theme.'=>'По умолчанию тест заполнит все свободное место, куда вы его вставите. Вы можете добавить сюда немного отступов, чтобы они лучше соответствовали вашей теме.','Choose how do you want to show quiz results to the participants.'=>'Выберите, как вы хотите показывать результаты викторины участникам.','Choose how much spacing you want between each quiz question.'=>'Выберите, сколько интервалов вы хотите сделать между каждым вопросом викторины.','Choose how you want your quiz to be rendered for users.'=>'Выберите, как вы хотите, чтобы ваш тест отображался для пользователей.','Choose the maximum container width for your quiz. Full Width means quiz container will fill the 100% available space where you insert it, and the Custom option lets you define a maximum container width.'=>'Выберите максимальную ширину контейнера для вашего теста. Полная ширина означает, что контейнер для викторины заполнит 100% свободного места, куда вы его вставляете, а пользовательский параметр позволяет задать максимальную ширину контейнера.','Choose the number of columns to fit in one row. Note that grid layout changes to list on smaller screens so this won\'t affect the smaller screens.'=>'Выберите количество столбцов, которое должно поместиться в одной строке. Обратите внимание, что макет сетки изменяется на список на меньших экранах, поэтому это не повлияет на меньшие экраны.','Choose the overall alignment of your quiz. This setting affects everything, including title, description, questions and answers, buttons, and social share message.'=>'Выберите общий формат вашего теста. Этот параметр влияет на все, включая заголовок, описание, вопросы и ответы, кнопки и сообщение в социальной сети.','Choose whether the quiz answers should appear in a list or a grid.'=>'Выберите, должны ли ответы на вопросы теста отображаться в виде списка или сетки.','Choose whether to allow site registrations on your multisite network and different related settings.'=>'Выберите, следует ли разрешать регистрацию сайтов в вашей многоузловой сети, а также различные связанные с этим настройки.','Choose whether you want to show a loader while evaluating the selected answer in real-time. We recommend using this on long quizzes since evaluating an answer might take a bit longer.'=>'Выберите, хотите ли вы показывать загрузчик при оценке выбранного ответа в режиме реального времени. Мы рекомендуем использовать это при проведении длинных тестов, так как оценка ответа может занять немного больше времени.','Columns per row'=>'Столбцы в строке','Confirm Password error message'=>'Сообщение об ошибке подтверждения пароля','Create custom user meta keys and assign your form fields to them to set additional user meta keys upon successful user registration.'=>'Создайте пользовательские пользовательские мета-ключи и назначьте им поля формы, чтобы установить дополнительные пользовательские мета-ключи после успешной регистрации пользователя.','Customize the quiz container as per your liking.'=>'Настройте контейнер для викторины по своему вкусу.','Customize your quiz layout by adjusting the answers layout and overall quiz alignment.'=>'Настройте свой макет теста, изменив макет ответов и общее выравнивание теста.','Delete meta'=>'Удалить мету','Display Method'=>'Способ отображения','Enter confirm password message'=>'Введите сообщение о подтверждении пароля','Evaluation Loader'=>'Оценочный загрузчик','No custom user meta created yet. Click on "+ Add Custom User Meta" to create custom user meta and map form fields to it.'=>'Пользовательская пользовательская мета еще не создана. Нажмите на "+ Добавить пользовательскую пользовательскую мету", чтобы создать пользовательскую пользовательскую мету и сопоставить с ней поля формы.','Note: You can change the color of the loader in the Appearance tab.'=>'Примечание: Вы можете изменить цвет загрузчика на вкладке Внешний вид.','Options cannot be empty. You either need to enter answer text or upload an image for the empty options.'=>'Параметры не могут быть пустыми. Вам нужно либо ввести текст ответа, либо загрузить изображение для пустых опций.','Quiz Alignment'=>'Выравнивание теста','Quiz Container'=>'Контейнер для викторины','Site address meta key will be automatically set based on this field as {{strong}}false{{/strong}}'=>'Мета-ключ адреса сайта будет автоматически установлен на основе этого поля как {{strong}}false{{{/strong}}','Site Registration'=>'Регистрация на сайте','Site Role'=>'Роль сайта','This picker works only when "Evaluation Loader" is set to "Show Loader".'=>'Этот инструмент выбора работает только тогда, когда для параметра "Оценочный загрузчик" установлено значение "Показать загрузчик".','This template allows you to create your own login form and insert it on a custom page. This doesn\'t modify the default login form.'=>'Этот шаблон позволяет вам создать свою собственную форму входа и вставить ее на пользовательскую страницу. Это не изменяет форму входа по умолчанию.','This template allows you to create your own registration form and insert it on a custom page. This doesn\'t modify the default registration form.'=>'Этот шаблон позволяет вам создать свою собственную регистрационную форму и вставить ее на пользовательскую страницу. Это не изменяет регистрационную форму по умолчанию.','You need to select an associated personality for every option.'=>'Вам нужно выбрать соответствующую личность для каждого варианта.','You need to select at least one correct answer before you can add this question.'=>'Вам нужно выбрать хотя бы один правильный ответ, прежде чем вы сможете добавить этот вопрос.','Assign form fields to the default WordPress user meta keys (used in Profiles) below. You can assign a form field to multiple meta keys. If you assign a non-required form field to a required user meta, that form field will automatically become required in your form.'=>'Назначьте поля формы метаключам пользователя WordPress по умолчанию (используемым в профилях) ниже. Вы можете назначить поле формы нескольким мета-ключам. Если вы назначите необязательное поле формы требуемой мете пользователя, это поле формы автоматически станет обязательным в вашей форме.','Assign your form fields to the user meta keys to use the data collected from the visitor to create a user profile.'=>'Назначьте поля формы пользовательским метаключам, чтобы использовать данные, полученные от посетителя, для создания профиля пользователя.','Auto Generated Password'=>'Автоматически Сгенерированный пароль','Custom User Meta'=>'Пользовательская пользовательская Мета','Default Meta Keys'=>'Мета-ключи по умолчанию','User Meta Mapping'=>'Пользовательское мета-сопоставление','Confirmation Page'=>'Страница подтверждения','Activation Email'=>'Электронная почта для активации','By default, the user account is activated upon form submission. However, you can choose between {{strong}}Email Activation{{/strong}}, which requires the user to click on an activation email, or {{strong}}Manual Approval{{/strong}} which requires site admin to approve an account.'=>'По умолчанию учетная запись пользователя активируется при отправке формы. Однако вы можете выбрать между {{strong}}Email Activation{{{/strong}}, которая требует от пользователя нажатия на активационное письмо, или {{strong}}Manual Approval{{{/strong}}, которая требует от администратора сайта одобрения учетной записи.','A site admin will have to manually approve each entry from the submissions page to activate the user accounts.'=>'Администратору сайта придется вручную утверждать каждую запись со страницы отправки, чтобы активировать учетные записи пользователей.','Automatically log in newly activated users'=>'Автоматический вход в систему новых активированных пользователей','By default, WordPress sends an activation email containing user account information after the account activation. However, you can choose not to send this email.'=>'По умолчанию WordPress отправляет электронное письмо для активации, содержащее информацию об учетной записи пользователя, после активации учетной записи. Однако вы можете отказаться от отправки этого письма.','Choose the page to redirect users to when they click on the confirmation link.'=>'Выберите страницу, на которую будут перенаправляться пользователи при нажатии на ссылку подтверждения.','Email Activation'=>'Активация по электронной почте','If you don\'t want to create a user in the network\'s main site, set this meta key to {{strong}}Don\'t create a user in the network\'s main site{{/strong}}.'=>'Если Вы не хотите создавать пользователя на основном сайте сети, установите этот мета-ключ в {{strong}}Не создавайте пользователя на основном сайте сети{{{/strong}}.','Manual Approval'=>'Ручное утверждение','Network\'s Main Site Role'=>'Роль основного сайта сети','Since the activation requires manual approval from site admin, it\'s recommended to keep this option to {{strong}}Default{{/strong}} to let users know when their account is activated.'=>'Так как активация требует ручного одобрения от администратора сайта, рекомендуется оставить эту опцию в {{strong}}Default{{{/strong}}, чтобы пользователи знали, когда их учетная запись активирована.','Since the {{strong}}Password{{/strong}} user meta key is mapped to {{strong}}Auto Generate Password{{/strong}}, it\'s recommended to keep this option to {{strong}}Default{{/strong}} so the auto-generated password can be sent to the users.'=>'Так как мета-ключ пользователя {{strong}} Пароль {{/strong}} сопоставлен с {{strong}} Автогенерировать пароль {{/strong}}, рекомендуется оставить для этого параметра значение {{strong}} По умолчанию {{/strong}}, чтобы автоматически сгенерированный пароль можно было отправлять пользователям.','These settings will add some extra control on your registration process.'=>'Эти настройки добавят дополнительный контроль над процессом вашей регистрации.','This will automatically log in a user upon successful activation of their account.'=>'Это автоматически приведет к входу пользователя в систему после успешной активации его учетной записи.','Choose the activation method and other settings for the user accounts.'=>'Выберите способ активации и другие настройки для учетных записей пользователей.','Please select an email address for payment receipt.'=>'Пожалуйста, выберите адрес электронной почты для получения оплаты.','Email subject can\'t be empty'=>'Тема письма не может быть пустой','B'=>'B','Remember me'=>'Запомнить меня','Activation Method'=>'Способ активации','Choose whether to show the {{strong}}Remember Me{{/strong}} field in your form. This option will add a Remember Me checkbox before the submit button.'=>'Выберите, показывать ли поле {{strong}}Remember Me{{/strong}} в вашей анкете. Эта опция добавит флажок Запомнить меня перед кнопкой отправки.','Additional Settings'=>'Расширенные настройки','Remember Me Field'=>'Запомнить мои поля','Assign your form fields to the meta keys required to login a user.'=>'Назначьте поля формы мета-ключам, необходимым для входа пользователя в систему.','Cookie Expiration'=>'Истечение срока действия файлов cookie','Email body can\'t be empty'=>'Текст письма не может быть пустым','Enabling this will hide the form from logged-in users.'=>'Включение этого параметра скроет форму от вошедших в систему пользователей.','Form Fields Mapping'=>'Отображение полей формы','Hide the form if a user is already logged in'=>'Скрыть форму, если пользователь уже вошел в систему','KB'=>'КБ','Login Fields'=>'Поля для входа в систему','Login User'=>'Войти в систему Пользователя','Map your form fields to the meta keys and have additional control over the login form fields.'=>'Сопоставьте поля вашей формы с мета-ключами и получите дополнительный контроль над полями формы входа.','MB'=>'МБ','Message (optional)'=>'Сообщение (необязательно)','Please fix the error(s) in the EMAIL tab.'=>'Пожалуйста, исправьте ошибки на вкладке "Электронная ПОЧТА".','These settings will add some extra control on your login process.'=>'Эти настройки добавят дополнительный контроль над процессом входа в систему.','Type a message for logged in users here...'=>'Введите здесь сообщение для зарегистрированных пользователей...','User Account Activation'=>'Активация учетной записи пользователя','Users will have to provide login details again after the selected period.'=>'Пользователи должны будут снова предоставить данные для входа в систему по истечении выбранного периода.','You can optionally add a message for logged in users, which appears when the form is hidden.'=>'При желании вы можете добавить сообщение для вошедших в систему пользователей, которое появляется, когда форма скрыта.','Choose the default minimum height of your textarea field.'=>'Выберите минимальную высоту поля текстовой области по умолчанию.','Default height'=>'Высота по умолчанию','Rich-Text editor'=>'Форматированный текстовый редактор','Short'=>'Короткий','Confirm password'=>'Подтвердите пароль','Bad'=>'Плохо','Choose a minimum password strength required to force your users to sign up with a password stronger than the minimum requirement.'=>'Выберите минимальный уровень надежности пароля, необходимый для того, чтобы заставить ваших пользователей регистрироваться с использованием пароля, более надежного, чем минимальное требование.','Good'=>'Хорошо','Minimum password strength'=>'Минимальная надежность пароля','Strong'=>'Сильный','This is displayed when the user\'s password is weaker than the minimum requirement.'=>'Это отображается, когда пароль пользователя слабее минимального требования.','User Registration'=>'Регистрация пользователя','Email on element not found or not filled on submitted data.'=>'Электронная почта по элементу не найдена или не заполнена по представленным данным.','Provide the absolute URL of the page you want to redirect users to after submitting the login form. For example, to redirect users to the WordPress admin, use the URL  {{strong}}http://www.website.com/wp-admin/{{/strong}}.'=>'Укажите абсолютный URL на которую вы хотите перенаправить пользователей после отправки формы входа. Например, чтобы перенаправить пользователей к администратору WordPress, используйте URL {{strong}}http://www.website.com/wp-admin/{{/strong}}.','Client ID is optional, unless you are on %1$sAgency-Mode%2$s, then you can find your desired Client ID on the %3$sAccount Settings%4$s > %5$sAPI Keys%6$s'=>'Идентификатор клиента является необязательным, если только вы не находитесь в %1$sAgency-Mode%2$s, то вы можете найти желаемый идентификатор клиента в %3$sAccount Settings%4$s > %5$sAPI Keys%6$s','New User Registration on {site_url}'=>'Регистрация нового пользователя на {site_url}','Activate your account on {site_url}'=>'Активируйте свою учётную запись на {site_url}','Your new account on {site_title}'=>'Ваша новая учётная запись на {site_title}','Click on %1$sShow API Key%2$s, select and copy on the shown up value.'=>'Click on %1$sShow API Key%2$s, select and copy on the shown up value.','Click %1$sAdd a new Redirect URL%2$s.'=>'Нажмите %1$sAdd новый URL перенаправления%2$s.','Login to your Campaign Monitor account %1$shere%2$s.'=>'Войдите в свою учетную запись Campaign Monitor %1$shere%2$s.','New User Registration on {site_url} needs approval.'=>'Регистрация нового пользователя на {site_url} требует одобрения.','Next, go to the %1$sFeatures%2$s &gt; %3$sOAuth & Permissions%4$s &gt; %5$sRedirect URLs%6$s section.'=>'Далее перейдите к разделу %1$sFeatures%2$s &gt; %3$sOAuth & Permissions%4$s &gt; %5$sRedirect URLs%6$s.','Once the Project creation is completed go to the %1$sBasic Information%2$s. Then scroll through %3$sApp Credentials%4$s, to take a note of %5$sClient ID%6$s and %7$sClient Secret%8$s.'=>'После создания проекта перейдите к %1$sBasic Information%2$s. Затем прокрутите %3$sApp Credentials%4$s, чтобы обратить внимание на %5$sClient ID%6$s и %7$sClient Secret%8$s.','Thank you for signing up on our website. You are one step away from activating your account. '=>'Благодарим Вас за регистрацию на нашем сайте. Вы находитесь в одном шаге от активации своей учетной записи. ','Then click the %1$sAdd%2$s button.'=>'Затем нажмите кнопку %1$sAdd%2$s.','Then click the %1$sSave URLs%2$s button.'=>'Затем нажмите кнопку %1$sSave URLs%2$s.','User Confirmation Email'=>'Электронное письмо с подтверждением пользователя','You\'ll receive another email once the site admin approves your account. You should be able to login into your account after that.'=>'Вы получите еще одно электронное письмо, как только администратор сайта одобрит вашу учетную запись. После этого вы должны быть в состоянии войти в свою учетную запись.','Your new account on {site_title} is under review.'=>'Ваш новый аккаунт на {site_title} находится на рассмотрении.','Go %1$shere%2$s to create new Slack App.'=>'Перейдите %1$sздесь%2$s, чтобы создать новое приложение Slack.','Go to Account Settings, then navigate to %1$sAPI Keys%2$s section.'=>'Перейдите в Настройки учетной записи, затем перейдите в раздел %1$sAPI Keys%2$s.','Click {submission_url} to view the submission on your website\'s dashboard.'=>'Щёлкните по {submission_url}, чтобы просмотреть отправку на панели управления вашего веб-сайта.','We have sent you another email containing a confirmation link. Please click on that link to activate your account.'=>'Мы отправили вам еще одно письмо, содержащее ссылку для подтверждения. Нажмите на эту ссылку, чтобы активировать ваш аккаунт.','Register'=>'Регистрация','This message was sent from {site_url}'=>'Это сообщение было отправлено с {site_url}','Login'=>'Вход','Account registration successful. A website admin must approve your account before you can log in. You’ll receive an email when your account is activated.'=>'Регистрация учетной записи прошла успешно. Администратор веб-сайта должен одобрить вашу учетную запись, прежде чем вы сможете войти в систему. Вы получите электронное письмо, когда ваша учетная запись будет активирована.','Enter username or email address'=>'Введите имя пользователя или адрес электронной почты','Username or Email Address'=>'Имя пользователя или email-адрес','Registration'=>'Регистрация','Password: %s'=>'Пароль: %s','Remember Me'=>'Запомнить меня','Username: %s'=>'Имя пользователя: %s','That username is already activated.'=>'Это имя пользователя уже активировано.','Could not create user'=>'Не удалось создать пользователя','https://wordpress.org/'=>'https://ru.wordpress.org/','Password'=>'Пароль','Confirm new password'=>'Подтвердите новый пароль','Couldn&#8217;t register you&hellip; please contact us if you continue to have problems.'=>'Регистрация не удалась&hellip; Пожалуйста, сообщите нам, если это проблема повторится.','The username can not be empty.'=>'Имя пользователя не может быть пустым.','This username is already registered.'=>'Это имя пользователя уже зарегистрировано.','The email address can not be empty.'=>'Адрес электронной почты не может быть пустым.','This email address is already registered.'=>'Этот адрес электронной почты уже зарегистрирован.','Account registration successful. Please check your email inbox to activate your new account.'=>'Регистрация учетной записи прошла успешно. Пожалуйста, проверьте свой почтовый ящик, чтобы активировать новую учетную запись.','Authenticate to login'=>'Аутентификация для входа в систему','Calculating Result'=>'Вычисление результата','Enter your password'=>'Введите свой пароль','Error! Entry was not deleted.'=>'Ошибка! Запись не была удалена.','Invalid activation key.'=>'Неверный ключ активации.','Invalid entry ID.'=>'Неверный идентификатор входа.','That email address has already been used. Please check your inbox for an activation email. It will become available in a couple of days if you do nothing.'=>'Этот адрес электронной почты уже использовался. Пожалуйста, проверьте свой почтовый ящик на наличие письма для активации. Он станет доступен через пару дней, если вы ничего не предпримете.','That username is currently reserved but may be available in a couple of days'=>'Это имя пользователя в настоящее время зарезервировано, но может быть доступно через пару дней','The attached file is empty and can\'t be uploaded.'=>'Прикрепленный файл пуст и не может быть загружен.','The passcode was incorrect.'=>'Пароль был введен неверно.','The user is already active.'=>'Пользователь уже активен.','This email address is not valid.'=>'Этот адрес электронной почты недействителен.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'Это имя пользователя недопустимо, поскольку в нем используются недопустимые символы. Пожалуйста, введите действительное имя пользователя.','Whoops, the passcode you entered was incorrect or expired.'=>'Упс, введенный вами пароль был неверным или истек.','You must confirm your chosen password.'=>'Вы должны подтвердить выбранный вами пароль.','Your password doesn\'t meet the minimum strength requirement. We recommend using 8 or more characters with a mix of letters, numbers & symbols.'=>'Ваш пароль не соответствует минимальным требованиям к надежности. Мы рекомендуем использовать 8 или более символов с сочетанием букв, цифр и символов.','Your password is required'=>'Требуется ввести ваш пароль','Your passwords don\'t match.'=>'Ваши пароли не совпадают.','Confirm Password'=>'Подтвердить пароль','Powered by WordPress'=>'Сайт работает на WordPress','Select Year'=>'Выбрать год','Sorry, that email address is already used!'=>'Этот адрес email уже используется!','All Forms'=>'Все формы','1. Visit Forminator and preview your forms to make sure everything looks perfect and adjust your forms with the additional settings Forminator offers as per your needs.'=>'1. Посетите Forminator и просмотрите Ваши формы, чтобы убедиться, что все выглядит идеально, и отрегулируйте Ваши формы с помощью дополнительных настроек, которые предлагает Forminator в соответствии с Вашими потребностями.','3. Deactivate Contact Form 7 and the add-ons if you don’t wish to use them anymore.'=>'3. Деактивируйте Contact Form 7 и дополнения, если вы не хотите их больше использовать.','2. Use the Gutenberg block or shortcode to embed your forms in the required places.'=>'2. Используйте блок Gutenberg или шорткод для встраивания форм в необходимые места.','Deactivate contact form 7'=>'Деактивировать контактную форму 7','Retry Import'=>'Повторите попытку импорта','Select the form.'=>'Выберите форму.','We couldn\'t find any compatible data to import.'=>'Мы не смогли найти никаких совместимых данных для импорта.','We have encountered an error while importing your forms from Contact Form 7 and selected add-ons. Unable to solve this? Contact our %1$ssupport%2$s team for further help.'=>'Мы столкнулись с ошибкой при импорте ваших форм из Contact Form 7 и выбранных дополнений. Не можете решить эту проблему? Свяжитесь с нашей командой %1$ssupport%2$s для получения дальнейшей помощи.','Begin Import'=>'Начать импорт','Advanced Contact form 7 DB'=>'Расширенная контактная форма 7 DB','Choose the Contact Form 7 add-ons you wish to import form data and settings from. %1$sNote:%2$s The importer only supports the most widely used add-ons. For less common add-ons, you\'ll need to manually configure the equivalent functionality in those imported forms.'=>'Выберите дополнения контактной формы 7, из которых вы хотите импортировать данные и настройки формы. %1$sNote:%2$s Импортер поддерживает только наиболее широко используемые дополнения. Для менее распространенных дополнений вам потребуется вручную настроить эквивалентную функциональность в этих импортированных формах.','Contact Form 7 - reCAPTCHA v2'=>'Контактная форма 7 - reCAPTCHA v2','Contact Form 7 Conditional Fields'=>'Контактная форма 7 Условных полей','Contact Form 7 Database Addon – CFDB7'=>'Контактная форма 7 Дополнение к базе данных – CFDB7','Contact Form 7 Redirection'=>'Перенаправление контактной формы 7','Contact Form Submissions'=>'Отправка контактной формы','Enable honeypot protection on the imported forms in Forminator.'=>'Включите защиту honeypot для импортированных форм в Forminator.','Flamingo'=>'Фламинго','Following are the next recommended steps:'=>'Ниже приведены следующие рекомендуемые шаги:','Honeypot for Contact Form 7'=>'Горшочек с медом для контактной формы 7','Import redirection URL settings and apply them on your imported forms in Forminator. Note that Forminator doesn’t support passing form fields as query parameters into redirect URL, redirection delay, and running a script after form submission.'=>'Импортируйте настройки URL-адреса перенаправления и примените их к импортированным формам в Forminator. Обратите внимание, что Forminator не поддерживает передачу полей формы в качестве параметров запроса в URL перенаправления, задержку перенаправления и запуск скрипта после отправки формы.','Import your form fields conditions and apply them automatically on your imported forms.'=>'Импортируйте условия полей формы и автоматически применяйте их к импортированным формам.','Import your form submissions and show them on the submissions page.'=>'Импортируйте отправленные вами формы и покажите их на странице отправки.','Import your form submissions from CFDB7 add-on and show them on the submissions page.'=>'Импортируйте отправленные вами формы из дополнения CFDB7 и покажите их на странице отправки.','Import your form submissions from Flamingo and show them on the submissions page.'=>'Импортируйте отправленные вами формы из Flamingo и покажите их на странице отправки.','Import your reCaptcha v2 API keys and configure the reCaptcha v2 on your imported forms.'=>'Импортируйте ключи API reCAPTCHA v2 и настройте reCAPTCHA v2 в импортированных формах.','Please keep this modal open while we import your Contact Form 7 forms and add-ons. It will only take a few seconds.'=>'Пожалуйста, держите этот режим открытым, пока мы импортируем ваши формы контактной формы 7 и дополнения. Это займет всего несколько секунд.','We couldn\'t find any supported add-ons.'=>'Мы не смогли найти никаких поддерживаемых дополнений.','Your selected forms from Contact Form 7 and the add-ons imported successfully.'=>'Выбранные вами формы из контактной формы 7 и дополнения успешно импортированы.','Add-ons'=>'Дополнения','%1$s4. Additional settings:%2$s Forminator doesn\'t support CF7’s additional form settings.'=>'%1$s4. Дополнительные настройки:%2$s Forminator не поддерживает дополнительные настройки формы CF7.','%1$s5. Custom field IDs:%2$s Forminator creates a unique ID for each field, and the conditional logic relies on them. However, you can provide a custom CSS class for each field.'=>'%1$s5. Пользовательское поле IDs:%2$s Forminator создает уникальный ID для каждого поля, и условная логика полагается на них. Однако для каждого поля можно задать свой CSS-класс.','%1$s3. reCAPTCHA v3 integration:%2$s At this stage, Forminator can\'t import your existing reCAPTCHA integration. You can set this up manually on your imported forms once they are transferred.'=>'%1$s3. Интеграция reCAPTCHA v3:%2$s На этом этапе Forminator не может импортировать существующую интеграцию reCAPTCHA. Вы можете настроить это вручную в импортированных формах после их переноса.','Dismiss%1$s this notice%2$s'=>'Отклонить%1$s это уведомление%2$s','Specific Forms'=>'Конкретные формы','Third-Party Plugins'=>'Сторонние плагины','%1$s1. Quiz field:%2$s Forminator doesn\'t have a built-in quiz field, however, you can enable CAPTCHA and Honeypot protection on your imported forms.'=>'%1$s1. Поле для викторины:%2$s Forminator не имеет встроенного поля для викторины, однако вы можете включить защиту от CAPTCHA и Honeypot в импортированных формах.','Choose the forms you\'d like to import from the Contact Form 7 plugin. Note that we will strip off any %1$sunsupported form fields and settings%2$s during the import.'=>'Выберите формы, которые вы хотите импортировать из плагина Contact Form 7. Обратите внимание, что во время импорта мы удалим все %1$sнеподдерживаемые поля формы и настройки%2$s.','Contact Form 7 plugin is not active on your website.'=>'Плагин Contact Form 7 не активен на вашем сайте.','Import Contact Form 7 Forms'=>'Импорт Контактной формы 7 Форм','Import your existing forms and the relevant plugin settings from the Contact Form 7. The importer supports a few widely used add-ons as well.'=>'Импортируйте существующие формы и соответствующие настройки плагина из контактной формы 7. Импортер также поддерживает несколько широко используемых дополнений.','Import your forms from Gravity Forms'=>'Импортируйте свои формы из Gravity Forms','Import your forms from Ninja Forms'=>'Импортируйте свои формы из Ninja Forms','Ninja Forms'=>'Формы ниндзя','Unsupported form fields and settings'=>'Неподдерживаемые поля и настройки формы','Use this tool to import your existing forms from other third-party form builder plugins automatically to Forminator.'=>'Используйте этот инструмент для автоматического импорта существующих форм из других сторонних плагинов form Builder в Forminator.','We noticed that Contact Form 7 is active on your website. You can use our built-in Contact Form 7 importer to import your existing forms and the relevant plugin settings from Contact Form 7 to Forminator. The importer supports the most widely used add-ons as well.'=>'Мы заметили, что контактная форма 7 активна на вашем сайте. Вы можете использовать наш встроенный импортер контактной формы 7, чтобы импортировать существующие формы и соответствующие настройки плагина из контактной формы 7 в Forminator. Импортер также поддерживает наиболее широко используемые дополнения.','%1$s2. ConstantContact:%2$s Forminator doesn\'t integrate directly with ConstantContact. However, you can use %3$sWebhook integration%4$s to send your leads to ConstantContact.'=>'%1$s2. ConstantContact:%2$ss Forminator не интегрируется напрямую с ConstantContact. Однако вы можете использовать %3$sWebhook integration%4$s для отправки ваших потенциальных клиентов в ConstantContact.','Contact Form 7'=>'Contact Form 7','Gravity Forms'=>'Gravity Forms','Can\'t find form to import'=>'Не удается найти форму для импорта','Could not import the forms. Check if the selected form plugin is active'=>'Не удалось импортировать формы. Проверьте, активен ли выбранный плагин формы','Forminator - Import your Contact Form 7 forms automatically'=>'Forminator - Автоматически импортируйте вашу контактную форму 7 форм','Import Gravity Forms'=>'Импорт Гравитационных форм','Import Ninja Forms'=>'Импорт форм Ниндзя','Active Modules'=>'Активные модули','No pipeline found on your HubSpot account. Please create one.'=>'В вашем аккаунте HubSpot конвейер не найден. Пожалуйста, создайте его.','%1$sCongratulations!%2$s You have started collecting live payments on this form - that\'s awesome. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'%1$sБлагодарности!%2$s Вы начали собирать реальные платежи в этой форме - это потрясающе. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','Apply Submission Filters'=>'Применение фильтров отправки','Excellent! You\'ve been using Forminator for a while now. Hope you are enjoying it so far. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Превосходно! Вы уже некоторое время пользуетесь Forminator. Надеюсь, вам это пока нравится. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','Send email only if there are new submissions'=>'Отправляйте электронное письмо только в том случае, если есть новые материалы','Hey, we noticed you just crossed %1$s submissions%2$s on this %3$s - that\'s awesome! We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Эй, мы заметили, что вы только что перечеркнули %1$s submitions%2$s на этом %3$s - это потрясающе! Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','No Thanks'=>'Нет, спасибо','Awesome! You\'ve published more than %d modules with Forminator. Hope you are enjoying it so far. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Потрясающе! Вы опубликовали более модулей %d с помощью Forminator. Надеюсь, вам это пока нравится. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','Rate Forminator'=>'Рейтинг Forminator','Maybe later'=>'Возможно позже','All Form Fields'=>'Все поля формы','All Non Empty Fields'=>'Все непустые поля','Enter value'=>'Введите значение','Send'=>'Отправить','Query parameter (optional)'=>'Параметр запроса (необязательно)','Delete Notification'=>'Удалить уведомление','Please select rule'=>'Пожалуйста, выберите правило','Add Email Notification'=>'Добавить уведомление по электронной почте','Are you sure you wish to delete this Notification?'=>'Вы уверены, что хотите удалить это уведомление?','BCC Emails'=>'Электронные письма BCC','By default, this email is always sent on form submission. You can add conditions to send this email conditionally based on user input.'=>'По умолчанию это электронное письмо всегда отправляется при отправке формы. Вы можете добавить условия для отправки этого электронного письма условно на основе пользовательских данных.','CC Emails'=>'Электронные письма CC','Choose whether to show a progress indicator on top of your form, so your users know how far they are through your form.'=>'Выберите, показывать ли индикатор выполнения поверх вашей формы, чтобы ваши пользователи знали, как далеко они продвинулись по вашей форме.','Choose whether you want to show the files uploaded by your visitors using this field in your media library.'=>'Выберите, хотите ли вы показывать файлы, загруженные вашими посетителями, используя это поле в вашей медиатеке.','Don\'t Send'=>'Не отправляйте','E.g. New Form Submission'=>'Например. Подача новой формы','E.g. Sales Team Notification'=>'Например, уведомление отдела продаж','E.g. sales@website.com'=>'Например, sales@website.com','Email Routing'=>'Маршрутизация электронной почты','Email routing is enabled'=>'Маршрутизация электронной почты включена','Enter BCC email here'=>'Введите адрес электронной почты BCC здесь','Enter CC email here'=>'Введите адрес электронной почты CC здесь','Enter from email here'=>'Введите адрес электронной почты здесь','Enter from name here'=>'Введите здесь имя пользователя','Enter reply-to email here'=>'Введите ответ на электронное письмо здесь','more recipient(s)'=>'больше получателей(ов)','No Next button'=>'Нет следующей кнопки','No Previous button'=>'Нет предыдущей кнопки','Page/Post Title'=>'Заголовок страницы/ Сообщения','Page/Post URL'=>'URL страницы /Публикации','Please add email routing'=>'Пожалуйста, добавьте маршрутизацию электронной почты','Please enter recipients'=>'Пожалуйста, введите получателей','Pre-populate'=>'Предварительно заполнить','Routing Condition'=>'Условие маршрутизации','Send to {{strong}}"%(label)s"{{/strong}} if {{strong}}%(field)s{{/strong}} %(rule)s {{strong}}%(value)s{{/strong}}'=>'Отправить в {{strong}}"%(label)s"{{/strong}} если {{strong}}%(field)s{{{/strong}} %(rule)s {{{strong}}%(value)s{{/strong}}','Separate multiple emails with a comma'=>'Разделите несколько писем запятой','Show files in media library'=>'Показывать файлы в медиатеке','Site URL'=>'URL-адрес сайта','Social Share Message'=>'Сообщение в социальной сети','The default behavior is to send the email to the same recipients. If you want to send this email to different recipients conditionally, you can enable the email routing and change the recipients of this email based on the user input.'=>'По умолчанию электронное письмо отправляется тем же получателям. Если вы хотите отправить это электронное письмо разным получателям условно, вы можете включить маршрутизацию электронной почты и изменить получателей этого электронного письма на основе введенных пользователем данных.','this email if'=>'это электронное письмо, если','You can pre-populate this field dynamically using the query parameter passed in your form URL. Enter the query parameter key to fetch its value from your form URL below.'=>'Вы можете предварительно заполнить это поле динамически, используя параметр запроса, переданный в URL-адресе вашей формы. Введите ключ параметра запроса, чтобы получить его значение из приведенного ниже URL-адреса вашей формы.','You can send customized email notifications to your site admins and visitors on successful form submission. Advanced features like email routing and conditional emails provide granular control over the email notifications.'=>'Вы можете отправлять индивидуальные уведомления по электронной почте администраторам и посетителям вашего сайта об успешной отправке формы. Расширенные функции, такие как маршрутизация электронной почты и условные электронные письма, обеспечивают детальный контроль над уведомлениями по электронной почте.','You haven\'t defined any email routing rules yet. Click on the "+ Add Rule" button to add the recipients along with the routing rules.'=>'Вы еще не определили никаких правил маршрутизации электронной почты. Нажмите на кнопку "+ Добавить правило", чтобы добавить получателей вместе с правилами маршрутизации.','Empty labels are not allowed for meta values!'=>'Пустые этикетки не допускаются для мета-значений!','The label is to help you identify this email and won\'t appear anywhere in the email.'=>'Этикетка предназначена для того, чтобы помочь вам идентифицировать это электронное письмо, и она нигде не появится в письме.','Your form is divided into multiple pages by Page Break field(s), and you can customize the label of each page here. Page names appear on your form header along with the progress indicator.'=>'Ваша форма разделена на несколько страниц с помощью полей (полей) разрыва страницы, и вы можете настроить этикетку каждой страницы здесь. Названия страниц отображаются в заголовке формы вместе с индикатором выполнения.','From Email'=>'Из Email','Query parameter'=>'Параметр запроса','d-m-Y'=>'д-м-У','d.m.Y'=>'д.м.Н.','E.g. query_parameter_key'=>'Например. query_parameter_key','m-d-Y'=>'м-д-У','m.d.Y'=>'м.д.У','Note: Pass comma-separated values for this query parameter to pre-populate multiple options.'=>'Примечание: Передайте значения этого параметра запроса через запятую, чтобы предварительно заполнить несколько параметров.','Note: The query parameter\'s value passed in URL should match with the selected date format.'=>'Примечание: Значение параметра запроса, переданное в URL, должно совпадать с выбранным форматом даты.','Note: The query parameter\'s value passed in URL should match with the {{link}}alpha-2 country code{{/link}} of the country you want to pre-populate dynamically.'=>'Замечание: Значение параметра запроса, передаваемое в URL, должно совпадать с кодом страны {{{link}}alpha-2{{/link}} страны, которую вы хотите динамически препарировать.','Y.m.d'=>'Y.М.д.','Y/m/d'=>'d.m.Y','Authorize Forminator to access HubSpot tickets'=>'Авторизуйте Forminator для доступа к билетам HubSpot','Create a HubSpot ticket for each submission'=>'Создайте тикет HubSpot для каждой отправки','Create Ticket'=>'Создать тикет','Field Mapping'=>'Отображение полей','Forminator requires additional permissions to create HubSpot tickets. Note that you will be taken to HubSpot website to grant Forminator access to HubSpot tickets and redirected back here.'=>'Forminator требует дополнительных разрешений для создания билетов на HubSpot. Обратите внимание, что вы попадете на сайт HubSpot, чтобы предоставить Forminator доступ к билетам HubSpot, и будете перенаправлены обратно сюда.','HubSpot List (optional)'=>'Список точек доступа (необязательно)','No static lists found on your HubSpot account'=>'В вашем аккаунте HubSpot не найдено статических списков','Pipeline'=>'Трубопровод','Select a file upload field'=>'Выберите поле для загрузки файла','Select a list'=>'Выберите список','Static list only'=>'Только статический список','Supported File (optional)'=>'Поддерживаемый файл (необязательно)','Ticket Description (optional)'=>'Описание билета (необязательно)','Ticket Name'=>'Название билета','Ticket Status'=>'Статус билета','Use the "+" icon to add form fields'=>'Используйте значок "+" для добавления полей формы','You can optionally add the contact to a static HubSpot list. Leave it empty to create a contact without adding it to a list.'=>'При желании вы можете добавить контакт в статический список HubSpot. Оставьте его пустым, чтобы создать контакт, не добавляя его в список.','Since you are using Page Break field(s) to divide your form into multiple pages, use the pagination settings to customize the page label, progress indicator, and the buttons on each page.'=>'Поскольку вы используете поля разрыва страницы для разделения формы на несколько страниц, используйте параметры разбивки на страницы, чтобы настроить этикетку страницы, индикатор выполнения и кнопки на каждой странице.','Page '=>'Страница ','Page Break'=>'Разрыв страницы','Query Parameter'=>'Параметр запроса','Previous'=>'Назад','I got {quiz_result} on {quiz_name} quiz!'=>'У меня есть {quiz_result} на {quiz_name} викторину!','Pipeline can not be empty.'=>'Конвейер не может быть пустым.','Stripe Payment ID does not exist.'=>'Идентификатор платежа Stripe не существует.','Recommendations'=>'Рекомендации','Error: Module object is corrupted!'=>'Ошибка: Объект модуля поврежден!','Error: Stripe field doesn\'t exist in your form!'=>'Ошибка: поле Stripe не существует в вашей форме!','Error: Your module ID doesn\'t exist!'=>'Ошибка: Ваш идентификатор модуля не существует!','Payment amount should be larger than 0.'=>'Сумма платежа должна быть больше 0.','Selected Forms'=>'Выбранные формы','Your Payment ID is empty!'=>'Ваш идентификатор платежа пуст!','Postal code'=>'Почтовый индекс','Payment Receipt'=>'Квитанция об оплате','Auto'=>'Авто','Base class'=>'Базовый класс','E.g. Company Name'=>'Например, название компании','Payment description'=>'Описание платежа','Meta Data'=>'Мета данные','Billing Details'=>'Платёжные реквизиты','Autofilled (Chrome and Safari only)'=>'Автозаполнение (только для Chrome и Safari)','Billing address (optional)'=>'Платежный адрес (необязательно)','Card icon'=>'Значок карты','Card Validation'=>'Проверка подлинности карты','Choose whether you want to collect the postal code on the Stripe field.'=>'Выберите, хотите ли вы получить почтовый индекс в поле Stripe.','Choose whether you want to show the card icon on the Stripe field.'=>'Выберите, хотите ли вы отображать значок карты в поле Полосы.','Choose your preferred language for the Stripe field. This will affect the placeholders language, and the card validation errors returned by the Stripe.'=>'Выберите предпочитаемый язык для поля Stripe. Это повлияет на язык заполнителей и ошибки проверки карты, возвращаемые Stripe.','Customer email address (optional)'=>'Адрес электронной почты клиента (необязательно)','Customer name (optional)'=>'Имя клиента (необязательно)','Empty'=>'Пусто','Focused'=>'Сосредоточенный','If you are already collecting ZIP code on your form, you can pre-fill it on the Stripe field.'=>'Если вы уже указываете почтовый индекс в своей форме, вы можете предварительно заполнить его в поле Stripe.','If you are collecting billing details on your forms, you can send that data to Stripe. The billing details will appear on your Stripe dashboard for each payment.'=>'Если вы собираете платежные данные в своих формах, вы можете отправить эти данные в Stripe. Платежные данные будут отображаться на панели управления Stripe для каждого платежа.','Note: Stripe field automatically validates the card as the user fills the card details regardless of the validation behavior set on the Behaviours tab.'=>'Примечание: Поле Stripe автоматически проверяет карту, когда пользователь заполняет данные карты, независимо от режима проверки, установленного на вкладке "Поведение".','Payment Details (optional)'=>'Платежные реквизиты (необязательно)','Please enter PayPal payment amount!'=>'Пожалуйста, введите сумму платежа PayPal!','Please select PayPal payment variable field!'=>'Пожалуйста, выберите поле переменной оплаты PayPal!','Prefill (optional)'=>'Предварительная заливка (необязательно)','Select a name field'=>'Выберите поле имени','Select an address field'=>'Выберите поле адреса','Statement decipher'=>'Расшифровка заявления','This appears on your Stripe account and on the payment receipt sent to your customers.'=>'Это отображается в вашем аккаунте Stripe и в квитанции об оплате, отправленной вашим клиентам.','This is the business name your customers will see on their card statement.'=>'Это название компании, которое ваши клиенты будут видеть в выписке по своей карте.','Up to 22 characters only'=>'Только до 22 символов','You can add a statement decipher and a description to help you and your customers recognise the transactions made on this form.'=>'Вы можете добавить расшифровку выписки и описание, чтобы помочь вам и вашим клиентам распознавать транзакции, совершенные в этой форме.','Your All-in-One WordPress Platform'=>'Ваша универсальная платформа WordPress','Choose whether you want Stripe to email a receipt to your customers on successful payment. Note that Stripe sends the email receipt only for live payments. {{link}}Customize email template{{/link}}.'=>'Выберите, хотите ли вы, чтобы Stripe отправлял вашим клиентам квитанцию об успешной оплате по электронной почте. Обратите внимание, что Stripe отправляет квитанцию по электронной почте только для живых платежей. {{link}}Настроить шаблон электронной почты{{/link}}.','Stripe automatically adds classes to the container DOM element based on the field state. However, you can customize them here. {{link}}Read more{{/link}}'=>'Строка автоматически добавляет классы к контейнерному элементу DOM на основе состояния поля. Однако вы можете настроить их здесь. {{link}}Читать далее{{/link}}.','To make Forminator\'s Stripe field %1$sSCA Compliant%2$s, we have replaced the Stripe Checkout modal with Stripe Elements which adds an inline field to collect your customer\'s credit or debit card details. Your existing forms with Stripe field are automatically updated, but we recommend checking them to ensure everything works fine.'=>'Чтобы сделать поле Stripe Forminator %1$sSCA-совместимым%2$s, мы заменили модальное окно Stripe Checkout на Stripe Elements, которое добавляет встроенное поле для сбора данных кредитной или дебетовой карты вашего клиента. Ваши существующие формы с полем Stripe автоматически обновляются, но мы рекомендуем проверить их, чтобы убедиться, что все работает нормально.','Complete'=>'Выполнено','Credit / Debit Card'=>'Кредитная / дебетовая карта','Invalid'=>'Недействительный','"No votes yet" text color'=>'Цвет текста "Пока нет голосов"','Basics'=>'Основы','General settings'=>'Общие настройки','Modules Listing'=>'Список модулей','v2 Checkbox'=>'v2 Флажок','Tooltips'=>'Всплывающие подсказки','All the submissions deleted successfully.'=>'Все отправленные материалы успешно удалены.','Are you sure you want to disconnect your Stripe Account? This will affect the forms using the Stripe field.'=>'Вы уверены, что хотите отключить свою учетную запись Stripe? Это повлияет на формы, использующие поле Stripe.','Are you sure you wish to delete the submissions on this poll?'=>'Вы уверены, что хотите удалить материалы, представленные в этом опросе?','Chart grid lines'=>'Линии сетки диаграммы','Choose the graph colors for each poll answers below.'=>'Выберите цвета графика для каждого приведенного ниже ответа на опрос.','Choose the number of forms, polls, and quizzes to show on each listing page.'=>'Выберите количество форм, опросов и опросов, которые будут отображаться на каждой странице объявления.','Choose the number of items to show per page on your submissions or modules listing pages.'=>'Выберите количество элементов, которые будут отображаться на странице, на страницах со списком ваших материалов или модулей.','Choose the number of recent forms to be shown on your dashboard.'=>'Выберите количество последних форм, которые будут отображаться на вашей панели мониторинга.','Choose the number of recent polls to be shown on your dashboard.'=>'Выберите количество последних опросов, которые будут отображаться на вашей панели мониторинга.','Choose the number of recent quizzes to be shown on your dashboard.'=>'Выберите количество последних тестов, которые будут отображаться на вашей панели мониторинга.','Choose the number of submissions to show per page.'=>'Выберите количество материалов, которые будут отображаться на странице.','Customize the Forminator dashboard as per your liking.'=>'Настройте панель управления Forminator по своему вкусу.','Enter the API keys for each reCAPTCHA type you want to use in your forms. Note that each reCAPTCHA type requires a different set of API keys. %1$sGenerate API keys%2$s'=>'Введите ключи API для каждого типа reCAPTCHA, который вы хотите использовать в своих формах. Обратите внимание, что для каждого типа reCAPTCHA требуется свой набор ключей API. %1$sGenerate Ключи API%2$s','Enter the API keys for reCAPTCHA v2 Checkbox type below:'=>'Введите ключи API для reCAPTCHA v2 и введите флажок ниже:','Enter the API keys for reCAPTCHA v2 Invisible type below:'=>'Введите ключи API для reCAPTCHA v2 Невидимого типа ниже:','Enter the API keys for reCAPTCHA v3 type below:'=>'Введите ключи API для reCAPTCHA v3 типа ниже:','Error response message will be displayed after poll vote submission fails.'=>'Сообщение об ошибке будет выведено на экран после сбоя отправки результатов опроса.','If you see any errors in the preview, make sure the key you\'ve entered are valid, and you\'ve listed your domain name while generating the keys.'=>'Если вы видите какие-либо ошибки в предварительном просмотре, убедитесь, что введенный вами ключ действителен, и вы указали свое доменное имя при генерации ключей.','Legend text color'=>'Цвет текста легенды','Legends are always displayed on top of the chart.'=>'Легенды всегда отображаются в верхней части диаграммы.','Please enter valid number.'=>'Пожалуйста, введите действительный номер.','Please enter valid voting limit.'=>'Пожалуйста, введите действительный лимит голосов.','Submission delete failed.'=>'Не удалось удалить отправку.','submissions per page'=>'материалы на страницу','Successful response message will be displayed after poll submission succeeds.'=>'Сообщение об успешном ответе будет отображено после успешной отправки опроса.','Text displayed inside bars.'=>'Текст, отображаемый внутри столбцов.','Users see this text next to submit button when "link on poll" submission is enabled.'=>'Пользователи видят этот текст рядом с кнопкой отправки, когда включена отправка "ссылки на опрос".','v2 Invisible'=>'v2 Невидимый','v3 reCaptcha'=>'v3 reCAPTCHA','Votes count'=>'Подсчет голосов','Chart labels color'=>'Цвет этикеток диаграммы','1.0'=>'1.0','0.9'=>'0.9','0.8'=>'0.8','0.7'=>'0.7','0.6'=>'0.6','0.4'=>'0.4','0.3'=>'0.3','0.2'=>'0.2','0.1'=>'0.1','Size'=>'Размер','reCAPTCHA V3'=>'reCAPTCHA V3','0.5'=>'0.5','Your vote has been saved.'=>'Ваш голос был сохранен.','Authenticate'=>'Аутентификация','Choose the reCAPTCHA type you want to use on your form. You can read more about the different reCAPTCHA types {{link}}here{{/link}} and then choose the one which suits you the best.'=>'Выберите тип reCAPTCHA, который вы хотите использовать в вашей форме. Вы можете прочитать больше о различных типах reCAPTCHA {{link}}}где-нибудь{{/link}}, а затем выбрать тот, который подходит вам лучше всего.','Create Contact'=>'Создать контакт','%1$s Connected'=>'Подключено %1$s','0.0'=>'0','Job Title'=>'Название должности','Authenticate your HubSpot account using the button below. Note that you\'ll be taken to the HubSpot website to grant access to Forminator and then redirected back.'=>'Аутентифицируйте свою учетную запись HubSpot, используя кнопку ниже. Обратите внимание, что вы перейдете на веб-сайт HubSpot, чтобы предоставить доступ к Forminator, а затем будете перенаправлены обратно.','Authenticating'=>'Аутентификация','Authorizing HubSpot'=>'Авторизация HubSpot','Choose the error message you want to display on your form when reCAPTCHA verification fails.'=>'Выберите сообщение об ошибке, которое вы хотите отобразить в своей форме при сбое проверки reCAPTCHA.','Custom Answer Input'=>'Пользовательский ввод ответа','Deactivate this HubSpot Integration from this Form.'=>'Отключите эту интеграцию с HubSpot из этой формы.','Forminator Fields'=>'Поля Forminator','HubSpot Fields'=>'Поля HubSpot','No status found on your HubSpot account. Please create one.'=>'Статус не найден в вашем аккаунте HubSpot. Пожалуйста, создайте его.','Please enter API keys.'=>'Пожалуйста, введите ключи API.','Poll Basics'=>'Основы опроса','Poll Container'=>'Контейнер для опроса','Radio Options'=>'Опции радио','reCAPTCHA V3 returns a score (1 is very likely a good interaction, 0 is very likely a bot) based on user interaction. Choose the score below which the verification should fail.'=>'reCAPTCHA V3 возвращает оценку (1, скорее всего, хорошее взаимодействие, 0, скорее всего, бот) на основе взаимодействия с пользователем. Выберите оценку, ниже которой проверка должна завершиться неудачей.','reCAPTCHA verification failed. Please try again.'=>'ошибка проверки reCAPTCHA. Пожалуйста, попробуйте еще раз.','Results Chart'=>'Диаграмма результатов','Score Threshold'=>'Пороговое значение оценки','Successfully authorized HubSpot, you can go back to integration settings.'=>'После успешной авторизации HubSpot вы можете вернуться к настройкам интеграции.','Successfully send data to HubSpot'=>'Успешная отправка данных в HubSpot','V2 Checkbox'=>'Флажок V2','V2 Invisible'=>'V2 Невидимый','We recommend using sandbox mode to ensure the payments are working as expected and when you are ready to start collecting live payments, switch to the {{strong}}Live{{/strong}} payments mode.'=>'Мы рекомендуем использовать режим песочницы, чтобы убедиться, что платежи работают так, как ожидалось, и когда вы будете готовы начать сбор платежей в реальном времени, переключитесь на режим платежей {{strong}}Live{{{/strong}}.','You are already connected to the HubSpot. You can disconnect your HubSpot Integration (if you need to) using the button below.'=>'Вы уже подключены к HubSpot. Вы можете отключить интеграцию с HubSpot (если вам нужно), используя кнопку ниже.','reCAPTCHA type'=>'Тип reCAPTCHA','You are connected to %1$s%2$s%3$s.'=>'Вы подключены к %1$s%2$s%3$s.','Mar'=>'Мар','Blank'=>'Пустой','Close this dialog window.'=>'Закройте это диалоговое окно.','Services'=>'Услуги','Additional notes'=>'Дополнительные примечания','Apr'=>'Апрель','Aug'=>'Август','Deactivate'=>'Деактивировать','Deactivate Webhook from this Form.'=>'Деактивируйте Webhook из этой формы.','Dec'=>'Декабрь','Failed to configure PayPal payment'=>'Не удалось настроить платеж PayPal','Feb'=>'Февраль','Forminator Shortcodes'=>'Короткие коды Forminator','has been disconnected successfully.'=>'был успешно отключен.','is activated successfully.'=>'успешно активируется.','is connected successfully.'=>'успешно подключен.','Jan'=>'Янв.','Jul'=>'Июль','Jun'=>'Июнь','North Macedonia'=>'Северная Македония','Nov'=>'Ноябрь','Oct'=>'Октябрь','PayPal amount must be greater than 0.'=>'Сумма PayPal должна быть больше 0.','Please, select an option before you proceed.'=>'Пожалуйста, выберите вариант, прежде чем продолжить.','Quote Request'=>'Запрос котировки','Request Quote'=>'Запрос котировки','Select an option from the dropdown menu and generate a shortcode to insert in your post or page.'=>'Выберите нужный вариант из выпадающего меню и сгенерируйте шорткод для вставки в свой пост или страницу.','Select Custom Form'=>'Выберите Пользовательскую форму','Sep'=>'Сентябрь','Some error has occurred while connecting to your PayPal account. Please resolve the following errors and try to connect again.'=>'Произошла какая-то ошибка при подключении к вашей учетной записи PayPal. Пожалуйста, устраните следующие ошибки и попробуйте подключиться снова.','Subscribe'=>'Подписка','Stripe Payment'=>'Оплата через систему Stripe','Choose an option'=>'Выбрать опцию','Generate Shortcode'=>'Генерация шорткода','Submitting...'=>'Отправка...','Active Apps'=>'Активные приложения','Activate App'=>'Активировать приложение','Available Apps'=>'Доступные приложения','Choose a template'=>'Выберите шаблон','Client Id'=>'Идентификатор клиента','Select rule'=>'Выберите правило','Select month'=>'Выберите месяц','Condition (required)'=>'Условие (обязательное)','Choose the default charge currency for your PayPal payments. You can override this while setting up the PayPal field in your forms.'=>'Выберите валюту оплаты по умолчанию для ваших платежей PayPal. Вы можете переопределить это при настройке поля PayPal в своих формах.','Configure App'=>'Настройка приложения','Connect App'=>'Подключить приложение','Connect PayPal Account'=>'Подключить учетную запись PayPal','Connect To PayPal'=>'Подключение к PayPal','Connect your PayPal business account with Forminator to use PayPal field for collecting payments in your forms.'=>'Подключите свой бизнес-аккаунт PayPal к Forminator, чтобы использовать поле PayPal для сбора платежей в ваших формах.','Connected Apps'=>'Подключенные приложения','Customize one of our pre-made form templates, or start from scratch.'=>'Настройте один из наших готовых шаблонов форм или начните с нуля.','Day is'=>'День - это','day is'=>'день - это','Day is not'=>'День - это не','day is not'=>'день - это не','Disconnect PayPal Account'=>'Отключить учетную запись PayPal','Enter your live client id'=>'Введите свой реальный идентификатор клиента','Enter your live secret id'=>'Введите свой секретный идентификатор live secret id','Enter your PayPal REST API keys to connect your account. You can create a REST API app %1$shere%2$s to grab the credentials.'=>'Введите ключи PayPal REST API для подключения вашего счета. Вы можете создать приложение REST API %1$shere%2$s для получения учетных данных.','Enter your sandbox client id'=>'Введите свой идентификатор клиента песочницы','Enter your sandbox secret'=>'Введите свой секрет песочницы','Forminator integrates with your favorite third party apps. You can connect to the available apps via their API here and activate them to collect data in the Integrations tab of your forms, polls or quizzes.'=>'Forminator интегрируется с вашими любимыми сторонними приложениями. Вы можете подключиться к доступным приложениям через их API здесь и активировать их для сбора данных на вкладке интеграции ваших форм, опросов или опросов.','Live Client ID'=>'Живой идентификатор Клиента','Month is'=>'Месяц - это','month is'=>'месяц - это','Month is not'=>'Месяц - это не','month is not'=>'месяц - это не','Payment Data'=>'Платежные данные','PayPal account connected successfully. You can now add the PayPal field to your forms and start collecting payments.'=>'Учетная запись PayPal успешно подключена. Теперь вы можете добавить поле PayPal в свои формы и начать собирать платежи.','PayPal account disconnected successfully.'=>'Учетная запись PayPal успешно отключена.','PayPal debug mode helps troubleshoot any issues. However, it\'s recommended to disable this in production as it causes a significant increase in the script size and performance decrease.'=>'Режим отладки PayPal помогает устранять любые неполадки. Однако рекомендуется отключить это в рабочей среде, так как это приводит к значительному увеличению размера скрипта и снижению производительности.','Please connect your PayPal account first!'=>'Пожалуйста, сначала подключите свой аккаунт PayPal!','Please input live client id'=>'Пожалуйста, введите идентификатор реального клиента','Please input sandbox client id'=>'Пожалуйста, введите идентификатор клиента песочницы','Please input sandbox secret key'=>'Пожалуйста, введите секретный ключ песочницы','Sandbox Client ID'=>'Идентификатор клиента песочницы','Sandbox Secret'=>'Секрет Песочницы','Select an email field'=>'Выберите поле электронной почты','Stripe account disconnected successfully.'=>'Учетная запись Stripe успешно отключена.','These apps are collecting data of your module.'=>'Эти приложения собирают данные вашего модуля.','To activate any of these to collect data, go to the Integrations tab of your forms, polls or quizzes.'=>'Чтобы активировать любой из них для сбора данных, перейдите на вкладку Интеграции ваших форм, опросов или опросов.','To be able to use PayPal Payments feature please upgrade your PHP to %1$sversion %2$s%3$s or above.'=>'Для использования функции PayPal Payments, пожалуйста, обновите ваш PHP до версии %1$sversion %2$s%3$s или выше.','Use PayPal Checkout to process payments in your forms.'=>'Используйте PayPal Checkout для обработки платежей в ваших формах.','View Docs'=>'Просмотр документов','You are connected to these apps via their API. Connect to more apps on the %1$sIntegrations%2$s page.'=>'Вы подключены к этим приложениям через их API. Подключайтесь к другим приложениям на странице %1$sIntegrations%2$s.','You are not connected to any third party apps. You can connect to the available apps listed below and activate them in your modules to collect data.'=>'Вы не подключены ни к каким сторонним приложениям. Вы можете подключиться к доступным приложениям, перечисленным ниже, и активировать их в своих модулях для сбора данных.','You are not connected to any third party apps. You can connect to the available apps via their API on the %1$sIntegrations%2$s page and come back to activate them for collecting data of this module.'=>'Вы не подключены к сторонним приложениям. Вы можете подключиться к доступным приложениям через их API на странице %1$sIntegrations%2$s и вернуться, чтобы активировать их для сбора данных этого опроса.','You are not sending this module\'s data to any third party apps. You can activate any of the connected apps below and start sending this module\'s data to them.'=>'Вы не отправляете данные этого модуля в какие-либо сторонние приложения. Вы можете активировать любое из подключенных приложений ниже и начать отправлять им данные этого модуля.','You can have only one payment field in your form. Please delete the existing payment field to add another one.'=>'В вашей форме может быть только одно поле для оплаты. Пожалуйста, удалите существующее поле оплаты, чтобы добавить другое.','You can have only one PayPal field in your form for PayPal to work accurately. Please delete the existing PayPal field to add a new one.'=>'У вас может быть только одно поле PayPal в вашей форме, чтобы PayPal работал точно. Пожалуйста, удалите существующее поле PayPal, чтобы добавить новое.','You can send this form\'s data to any of the connected third party apps. Connect to more apps on the {{link}}Integrations{{/link}} page.'=>'Вы можете отправить данные этой формы в любое из подключенных сторонних приложений. Подключайтесь к большему количеству приложений на странице {{link}}Интеграции{{/link}}.','You\'ve entered an invalid live client id'=>'Вы ввели неверный идентификатор реального клиента','You\'ve entered an invalid sandbox client id'=>'Вы ввели неверный идентификатор клиента изолированной среды','You\'ve entered an invalid sandbox secret key'=>'Вы ввели недопустимый секретный ключ песочницы','Connect to more third party apps on the %1$sIntegrations%2$s page and activate them to collect the data of this module here.'=>'Подключитесь к другим сторонним приложениям на странице %1$s Integrations%2$s и активируйте их для сбора данных этого модуля здесь.','Account Type'=>'Тип аккаунта','Customize'=>'Настроить','Debug Mode'=>'Режим отладки','Height'=>'Высота','px'=>'px','E.g. 250'=>'Например, 250','White'=>'Белый','Sandbox'=>'Песочница','Blue'=>'Синий','By default, PayPal detects the language for the visitors based on their geolocation and browser preferences. It is recommended to pass this parameter only if you need the PayPal buttons to render in the same language as the rest of your site. {{link}}Supported locale codes.{{/link}}'=>'По умолчанию PayPal определяет язык для посетителей на основе их геолокации и предпочтений браузера. Рекомендуется передавать этот параметр только в том случае, если вам нужны кнопки PayPal для рендеринга на том же языке, что и остальной сайт. {{link}} Поддерживаемые коды локали.{{/link}}','Choose whether to show the default PayPal tagline {{strong}}"The safer, easier way to pay"{{/strong}} below your PayPal button.'=>'Выберите, следует ли показывать под кнопкой PayPal теглайн по умолчанию {{strong}} "Более безопасный и простой способ оплаты"{{/strong}}.','Horizontal'=>'Горизонтально','Vertical'=>'Вертикально','Layout'=>'Макет','Tagline'=>'Краткое описание','By default, we stack the options vertically. However, you can change the options layout below.'=>'По умолчанию мы складываем параметры вертикально. Однако вы можете изменить расположение параметров ниже.','Choose the height of PayPal Smart Buttons. It can be anywhere between 25px to 55px'=>'Выберите высоту смарт-кнопок PayPal. Он может быть где угодно между 25px и 55px','Choose the text to show on the right of loading icon'=>'Выберите текст, который будет отображаться справа от значка загрузки','Choose the width of PayPal Smart Buttons. It can be anywhere between 150px to 750px. Leave this empty if you want the buttons to take the full width of the form up to the 750px limit.'=>'Выберите ширину смарт-кнопок PayPal. Он может быть где угодно между 150px и 750px. Оставьте это поле пустым, если вы хотите, чтобы кнопки занимали всю ширину формы до предела в 750 пикселей.','Choose whether you want to show a loader on your form until it is submitted. We highly recommend using this on long forms or forms with payment field since they may take a few seconds to submit.'=>'Выберите, хотите ли вы показывать загрузчик в своей форме до тех пор, пока он не будет отправлен. Мы настоятельно рекомендуем использовать это для длинных форм или форм с полем оплаты, поскольку их отправка может занять несколько секунд.','Choose your preferred shape from your PayPal Smart Buttons.'=>'Выберите желаемую форму с помощью смарт-кнопок PayPal.','E.g. Submitting...'=>'Например, Подчинение...','Eg. en_US'=>'Например. en_US','Gold'=>'Золото','It\'s recommended to charge in your customers\' currency to drive more sales and avoid foreign exchange fee to your customers.'=>'Рекомендуется взимать плату в валюте ваших клиентов, чтобы увеличить объем продаж и избежать комиссии за обмен валюты для ваших клиентов.','Pay with PayPal'=>'Оплата с помощью PayPal','PayPal Checkout'=>'Оформить заказ через PayPal','PayPal field replaces the submit button of your form with the PayPal Smart Payment Buttons. The PayPal buttons will automatically submit the form after a successful payment.'=>'Поле PayPal заменяет кнопку отправки вашей формы кнопками смарт-платежей PayPal. Кнопки PayPal автоматически 