те использовать для ограничения количества голосов.','Keyword: %s'=>'Ключевое слово: %s','Key Type'=>'Тип ключа','Payments settings'=>'Настройки платежей','Multiply'=>'Умножение','%s does not exist in your form. Please insert a valid field from the merged tags option.'=>'%s не существует в вашей форме. Пожалуйста, вставьте допустимое поле из опции объединенные теги.','Add Custom Meta'=>'Добавить пользовательскую Мету','Add Form Fields'=>'Добавление полей формы','Are you sure you want to disconnect your PayPal Account? This will affect the forms using the PayPal field.'=>'Вы уверены, что хотите отключить свою учетную запись PayPal? Это повлияет на формы, использующие поле PayPal.','Assign a calculation value to each option. These values will not be shown on the form. You can assign only a numeric value.'=>'Присвойте каждому параметру расчетное значение. Эти значения не будут показаны в форме. Вы можете присвоить только числовое значение.','Browser Cookie'=>'Файл cookie браузера','By default, a user can only vote once on a poll. However, you can allow the users to vote multiple times and also specify the time after which a user can vote again.'=>'По умолчанию пользователь может проголосовать в опросе только один раз. Однако вы можете разрешить пользователям голосовать несколько раз, а также указать время, по истечении которого пользователь может проголосовать снова.','Calculation Formula'=>'Формула расчета','Calculation formula is required!'=>'Требуется формула расчета!','Calculation value is required!'=>'Требуется расчетное значение!','Calculation values are required!'=>'Расчетные значения обязательны!','Choose the default charge currency for your Stripe payments. You can override this while setting up the Stripe field in your forms.'=>'Выберите валюту начисления по умолчанию для ваших платежей Stripe. Вы можете переопределить это при настройке поля Stripe в ваших формах.','Choose whether to allow this field to be used in calculations or not. The value used in calculations is the same as the input value of this field.'=>'Выберите, разрешать ли использование этого поля в вычислениях или нет. Значение, используемое в вычислениях, совпадает с входным значением этого поля.','Choose whether you want to limit the number of votes per users and how do you want to impose that limit. '=>'Выберите, хотите ли вы ограничить количество голосов на одного пользователя и как вы хотите ввести это ограничение. ','Close parenthesis'=>'Закрыть круглые скобки','Connect Stripe Account'=>'Подключить учетную запись Stripe','Connect To Stripe'=>'Подключение к Stripe','Connect your Stripe account with Forminator to use Stripe field for processing payments in your forms.'=>'Подключите свою учетную запись Stripe к Forminator, чтобы использовать поле Stripe для обработки платежей в ваших формах.','Default charge currency'=>'Валюта платежа по умолчанию','Delete MetaData'=>'Удаление метаданных','Disconnect Stripe Account'=>'Отключить учетную запись Stripe','Enable TinyMCE editor to allow the formatted text.'=>'Включите редактор TinyMCE, чтобы разрешить форматированный текст.','Enter your live publishable key'=>'Введите свой живой публикуемый ключ','Enter your live secret key'=>'Введите свой живой секретный ключ','Enter your Stripe API keys below to connect your account. You can grab your API keys from %1$shere%2$s.'=>'Введите ниже ключи Stripe API для подключения вашего аккаунта. Вы можете получить свои API ключи от %1$shere%2$s.','Enter your test publishable key'=>'Введите свой тестовый публикуемый ключ','Enter your test secret key'=>'Введите свой тестовый секретный ключ','Failed to load Stripe Library, possibly conflict with other plugins. Please contact our support .'=>'Не удалось загрузить библиотеку Stripe, возможно, конфликт с другими плагинами. Пожалуйста, свяжитесь с нашей службой поддержки.','Formula Preview'=>'Предварительный просмотр формулы','From ID: %s'=>'От идентификатора: %s','Got It'=>'Понял это','If your form has file upload field(s), choose whether to delete the file(s) related to a submission when that submission gets deleted.'=>'Если в вашей форме есть поля для загрузки файлов, выберите, следует ли удалять файлы, связанные с отправкой, когда эта отправка будет удалена.','Infinity calculation result.'=>'Результат вычисления бесконечности.','Limit Min value should be less than Max value.'=>'Предельное минимальное значение должно быть меньше максимального значения.','Live Publishable Key'=>'Живой Публикуемый Ключ','Live Secret Key'=>'Живой Секретный Ключ','MetaData'=>'Метаданные','Minus'=>'Минус','No custom meta data created yet. Click on "+ Add Custom to create custom meta and map form fields to it.'=>'Пользовательские метаданные еще не созданы. Нажмите на "+ Добавить пользовательский, чтобы создать пользовательский мета-файл и сопоставить с ним поля формы.','Open list of fields'=>'Открыть список полей','Open parenthesis'=>'Открытые круглые скобки','Please fill required fields'=>'Пожалуйста, заполните обязательные поля','Please input live publishable key'=>'Пожалуйста, введите живой публикуемый ключ','Please input live secret key'=>'Пожалуйста, введите секретный ключ live','Please input test publishable key'=>'Пожалуйста, введите тестовый публикуемый ключ','Please input test secret key'=>'Пожалуйста, введите тестовый секретный ключ','Please, connect your Stripe account first!'=>'Пожалуйста, сначала подключите свой аккаунт Stripe!','Publishable Key'=>'Доступный для публикации Ключ','Remove this keyword'=>'Удалите это ключевое слово','Stripe account connected successfully. You can now add the Stripe field to your forms and start collecting payments.'=>'Учетная запись Stripe успешно подключена. Теперь вы можете добавить поле Stripe в свои формы и начать собирать платежи.','Submission Date Range: %1$s to %2$s'=>'Диапазон дат отправки: от %1$s до %2$s','Submission Files'=>'Файлы отправки','Submission limit'=>'Ограничение на отправку','Sum'=>'Сумма','Test Publishable Key'=>'Тестовый публикуемый ключ','Test 