','You\'ve entered an invalid live secret key'=>'Вы ввели недопустимый действующий секретный ключ','You\'ve entered an invalid test publishable key'=>'Вы ввели недопустимый тестовый публикуемый ключ','You\'ve entered an invalid test secret key'=>'Вы ввели недопустимый секретный ключ теста','Option labels are required!'=>'Опционные этикетки обязательны!','Configure'=>'Настроить','Connect'=>'Подключить','Divide'=>'Разделять','E.g. 20.00'=>'Например, 20.00','Swedish (sv)'=>'Шведский (sv)','Spanish (es)'=>'Испанский (es)','Italian (it)'=>'Итальянский (it)','German (de)'=>'Немецкий (de)','French (fr)'=>'Французский (fr)','Finnish (fi)'=>'Финский (fi)','Danish (da)'=>'Датский (da)','Read-only'=>'Только для чтения','Search'=>'Поиск','A currency field can be used to take user-defined payments such as donations and calculation field can be used to charge a calculated value based on a formula.'=>'Поле валюты можно использовать для приема определяемых пользователем платежей, таких как пожертвования, а поле расчета можно использовать для начисления расчетного значения на основе формулы.','By default, the calculation field is read-only. You can also hide the field if you don\'t want to show the calculated result on the form.'=>'По умолчанию поле расчета доступно только для чтения. Вы также можете скрыть поле, если не хотите показывать вычисленный результат в форме.','Choose the currency to display on the field. If you are going to collect payments based on this field, it is recommended to keep this currency same as your charge currency to avoid any confusions.'=>'Выберите валюту для отображения в поле. Если вы собираетесь получать платежи на основе этого поля, рекомендуется использовать эту валюту в той же валюте, что и валюта вашего платежа, чтобы избежать каких-либо недоразумений.','Choose whether to allow this field to be used in calculations or not.'=>'Выберите, разрешать ли использование этого поля в вычислениях или нет.','Display the search box in a dropdown'=>'Отобразите 