нять материалы этого теста?','If you use Forminator PRO to create and embed any quizzes on your website, you may need to mention it here to properly distinguish it from other quizzes.'=>'Если вы используете Forminator PRO для создания и встраивания каких-либо тестов на свой веб-сайт, вам может потребоваться упомянуть об этом здесь, чтобы правильно отличить его от других тестов.','If your quizzes utilize either built-in or external third party services, in this section you should mention any third parties and its privacy policy.'=>'Если ваши тесты используют встроенные или внешние сторонние сервисы, в этом разделе вы должны указать любые третьи стороны и их политику конфиденциальности.','In this section you should note what personal data you collected including which quizzes are available. You should also explain why this data is needed. Include the legal basis for your data collection and note the active consent the user has given.'=>'В этом разделе вы должны указать, какие персональные данные вы собрали, в том числе какие тесты доступны. Вы также должны объяснить, зачем нужны эти данные. Укажите правовую основу для сбора ваших данных и обратите внимание на активное согласие, данное пользователем.','Knowledge Quiz'=>'Тест на знание','Korea, Democratic People\'s Republic of'=>'Корея, Народно-Демократическая Республика','Korea, Republic of'=>'Корея, Республика Корея','Label color'=>'Цвет этикетки','Let\'s add the different personalities. Each of the following personality is a possible outcome of your quiz. In case of a tie, the personality is chosen as per their order below.'=>'Давайте добавим разные личности. Каждая из следующих личностей - это возможный результат вашего теста. В случае ничьей личность выбирается в соответствии с их порядком, приведенным ниже.','Martinique'=>'Martinique','Mayotte'=>'Mayotte','No data to be send to GoogleSheet'=>'Нет данных для отправки в GoogleSheet','No Quiz Settings available for %1$s'=>'Настройки викторины недоступны для %1$s','Optionally, you can send a notification email to nominated email accounts when quiz submissions come in.'=>'При желании вы можете отправить уведомление по электронной почте на назначенные учетные записи электронной почты при поступлении материалов викторины.','Personalities'=>'Личности','Personality Quiz'=>'Личностный тест','Please validate your fields!'=>'Пожалуйста, подтвердите свои поля!','Provide your visitors with more information about your quiz.'=>'Предоставьте своим посетителям больше информации о вашей викторине.','Publishing quiz…'=>'Викторина по публикации…','Quiz Description'=>'Описание викторины','Quiz name cannot be empty.'=>'Имя теста не может быть пустым.','Quiz Privacy'=>'Конфиденциальность викторины','Quiz result color'=>'Цвет результата теста','Quiz submissions disabled.'=>'Отправка материалов для викторины отключена.','Quiz with id %d could not be found'=>'Не удалось найти тест с идентификатором %d','Reorder the personalities to set the priority order.'=>'Измените порядок персоналий, чтобы установить приоритетный порядок.','Retake'=>'Пересдача','Retake Button'=>'Кнопка Пересдачи','Saint Pierre & Miquelon'=>'Saint Pierre & Miquelon','Show different outcomes depending on the visitor\'s answers. There are no wrong answers. E.g., Which superhero are you?'=>'Показывайте разные результаты в зависимости от ответов посетителя. Неправильных ответов не бывает. например, какой ты супергерой?','Social Share Title'=>'Название социальной акции','South Georgia and South Sandwich'=>'Южная Джорджия и Южный Сэндвич','Start by adding a title for your quiz to let your visitors know what this quiz is all about.'=>'Начните с добавления заголовка для вашего теста, чтобы ваши посетители знали, о чем этот тест.','Stateless Persons'=>'Лица без гражданства','Svalbard and Jan Mayen'=>'Шпицберген и Ян - Майен','Taiwan, Republic of China'=>'Тайвань, Китайская Республика','Test the knowledge of your visitors on a subject and final score is calculated based on number of right answers. E.g., Test your music knowledge.'=>'Проверьте знания ваших посетителей по предмету, и итоговый балл рассчитывается на основе количества правильных ответов. Например, проверьте свои знания музыки.','These will be output as you see them here. To add multiple classes, separate them with a space. For example, "form-submit-btn button" will add two classes "form-submit-btn" and "button".'=>'Они будут выведены в том виде, в каком вы их видите здесь. Чтобы добавить несколько классов, разделите их пробелом. Например, "кнопка form-submit-btn" добавит два класса "form-submit-btn" и "button".','This field is required!'=>'Это поле обязательно для заполнения!','This text will appear as button text while the quiz is being submitted.'=>'Этот текст будет отображаться в виде текста кнопки во время отправки теста.','Total Answers'=>'Всего ответов','Total Answers : '=>'Всего ответов : ','Turks And Caicos Islands'=>'Острова Теркс и Кайкос','Upload a nice feature image for your quiz.'=>'Загрузите красивое функциональное изображение для своей викторины.','Upload Feature Image'=>'Загрузить изображение объекта','US Minor Outlying Islands'=>'Малые отдаленные острова США','View Results Link'=>'Ссылка для просмотра результатов','Wallis And Futuna Islands'=>'Острова Уоллис и Футуна','When visitors or users answer a quiz we retain the <strong>answers</strong> data for 30 days and then remove it from our system.'=>'Когда посетители или пользователи отвечают на вопросы викторины, мы сохраняем данные <strong>ответов</strong> в течение 30 дней, а затем удаляем их из нашей системы.','When visitors or users submit a quiz\'s answer, we capture <strong>NO Personally Identifiable Information</strong>.'=>'Когда посетители или пользователи отправляют ответ на тест, мы фиксируем <strong>НЕТ Персонально идентифицируемой информации</strong>.','Which quizzes are collecting personal data?'=>'Какие тесты собирают персональные данные?','You need to save this quiz before using integrations.'=>'Вам необходимо